INSERT INTO `cms_email_templates` (`id`, `name`, `slug`, `subject`, `content`, `description`, `from_name`, `from_email`, `cc_email`, `created_at`, `updated_at`) VALUES
(1, 'Email Template Forgot Password Backend', 'forgot_password_backend', NULL, '<p>Hi,</p><p>Someone requested forgot password, here is your new password :</p><p>[password]</p><p><br></p><p>--</p><p>Regards,</p><p>Admin</p>', '[password]', 'System', 'system@crudbooster.com', NULL, '2019-05-14 05:07:05', NULL),
(2, 'Order Notification', 'order_notification', 'Replenishment System Notification', '<p>Hi, [name].</p><p><br></p><p>Here are the list of stores that do not have orders:</p><p><b>For RETAIL:</b></p><p>[rtl_stores_no_order]</p><p><br></p><p><b>For FRANCHISE:</b></p><p>[fra_stores_no_order]</p><p><br></p><p>Here are the list of stores that have orders pending for approval:</p><p><span style=\"font-weight: 700;\">For RETAIL:</span></p><p>[rtl_stores_pending]</p><p><br></p><p><span style=\"font-weight: 700;\">For FRANCHISE:</span></p><p>[fra_stores_pending]</p><p><br></p><p>Regards,</p><p><br></p><p><b>Michael Adrian Rodelas</b></p><p>Replenishment Sytem Administrator</p>', 'Replenishment Order Notification', 'Replenishment System', 'mikerodelas.digits@gmail.com', 'mikerodelas@digits.ph', '2019-06-29 02:49:49', '2020-01-07 21:44:13'),
(3, 'Order Notification Distribution', 'order_notification_dis', 'Replenishment System Notification', '<p>Hi, [name].</p><p><br></p><p>Here are the list of stores that do not have orders:</p><p><span style=\"font-weight: 700;\">For DISTRIBUTION:</span></p><p>[dis_stores_no_order]</p><p><br></p><p>Here are the list of stores that have orders pending for approval:</p><p><br></p><p><span style=\"font-weight: 700;\">For DISTRIBUTION:</span></p><p>[dis_stores_pending]</p><p><br></p><p>Regards,</p><p><br></p><p><span style=\"font-weight: 700;\">Michael Adrian Rodelas</span></p><p>Replenishment Sytem Administrator</p>', 'Replenishment Order Notification', 'Replenishment System', 'mikerodelas.digits@gmail.com', 'mikerodelas@digits.ph', '2019-07-03 17:14:07', '2020-01-07 21:44:29'),
(4, 'Assets Confirmation', 'assets_confirmation', 'Asset Delivery Confirmation', '<p>Hi<b> [assign_to]</b></p><p>A new item has been checked out under your name, details are below.</p><p><b>ARF#:&nbsp;</b><span style=\"text-align: center;\">[reference_number]</span></p><table border=\"1\" width=\"100%\" style=\"text-align:center;border-collapse: collapse;\"><tbody><tr><td style=\"text-align: center; \"><b>Reference Number<br></b></td><td style=\"text-align: center; \"><b>Assign Code<br></b></td><td style=\"text-align: center; \"><b>Digits Code<br></b></td><td style=\"text-align: center; \"><b>Item Description<br></b></td><td style=\"text-align: center; \"><b>Category<br></b></td><td style=\"text-align: center; \"><b>Serial No</b><br></td></tr><tr><td style=\"text-align: center; \">[mo_reference_number]<br></td><td style=\"text-align: center; \">[asset_code]<br></td><td style=\"text-align: center; \">[digits_code]<br></td><td style=\"text-align: center; \">[item_description]<br></td><td style=\"text-align: center; \">[item_category]<br></td><td style=\"text-align: center; \">[serial_no]<br></td></tr></tbody></table><span style=\"font-weight: 700;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><p>Please click on the link at the bottom to confirm that you have received the asset.</p><p> [systemlink]</p>', 'Assets Update', 'Digits Asset Management', 'noreply@digits.ph', NULL, '2022-07-12 06:31:11', '2022-10-05 11:44:18');
